import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import AdminLogin from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';
import ParentDashboard from './components/ParentDashboard';
import TeacherDashboard from './components/TeacherDashboard';
import ManagerDashboard from './components/ManagerDashboard';
import HeroSection from './components/HeroSection';
import PrivateRoute from './components/PrivateRoute';

function App() {
  // Vérifier si l'utilisateur est connecté
  const isAuthenticated = () => {
    const token = localStorage.getItem('token');
    const user = localStorage.getItem('user');
    return token && user;
  };

  // Rediriger vers le dashboard approprié si déjà connecté
  const getRedirect = () => {
    if (!isAuthenticated()) return null;
    const user = JSON.parse(localStorage.getItem('user'));
    return `/${user.role}/dashboard`;
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <Routes>
          {/* Routes publiques */}
          <Route path="/" element={
            isAuthenticated() ? <Navigate to={getRedirect()} /> : <HeroSection />
          } />
          <Route path="/login" element={
            isAuthenticated() ? <Navigate to={getRedirect()} /> : <Login />
          } />
          <Route path="/register" element={
            isAuthenticated() ? <Navigate to={getRedirect()} /> : <Register />
          } />
          <Route path="/admin/login" element={<AdminLogin />} />

          {/* Routes protégées */}
          <Route path="/admin/dashboard/*" element={
            <PrivateRoute>
              <AdminDashboard />
            </PrivateRoute>
          } />
          <Route path="/parent/dashboard/*" element={
            <PrivateRoute>
              <ParentDashboard />
            </PrivateRoute>
          } />
          <Route path="/teacher/dashboard/*" element={
            <PrivateRoute>
              <TeacherDashboard />
            </PrivateRoute>
          } />
          <Route path="/manager/dashboard/*" element={
            <PrivateRoute>
              <ManagerDashboard />
            </PrivateRoute>
          } />

          {/* Redirection par défaut */}
          <Route path="*" element={<Navigate to="/" replace />} />
          {/* Route protégée pour le dashboard admin */}
          <Route 
            path="/admin/dashboard/*" 
            element={
              <PrivateRoute>
                <AdminDashboard />
              </PrivateRoute>
            } 
          />

          {/* Autres routes protégées */}
          <Route path="/parent/dashboard/*" element={<PrivateRoute><ParentDashboard /></PrivateRoute>} />
          <Route path="/teacher/dashboard/*" element={<PrivateRoute><TeacherDashboard /></PrivateRoute>} />
          <Route path="/manager/dashboard/*" element={<PrivateRoute><ManagerDashboard /></PrivateRoute>} />

          {/* Redirection par défaut */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
